    {
     "type": "html",
     "name": "question17",
     "width": "600px",
     "minWidth": "600px",
     "maxWidth": "600px",
     "html": "<h4 style=\"text-align:left\"><b>\nWill you receive any results about yourself or your child from participating in this study?</b> </h4>\n\n<p style=\"text-align:left;color:black;font-size:16px\">While the study will not provide medical care, if the answers you give us in some of the questionnaires suggest that you are having serious problems with your mental health, we will let you know, and assist you in finding help. If there is something the study doctors notice when looking at your child’s MRI scan that might need further evaluation, we will let you know and assist you in deciding what you can do next.</p>\n<h4 style=\"text-align:left\"><b><i>Who can you call if you have questions?</i></b></h4>\n\n<p style=\"text-align:left;color:black;font-size:16px\">This study has been explained to you and your questions have been answered. If you have other questions or research-related problems, you may reach Dr. Merhar at 513.803.5180.</p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">You may call the Institutional Review Board at 513.636.8039 to inquire about your or your child’s rights as a research subject or to report research-related problems. </p>"
    }
   ],
   "visibleIf": "{fromInternal} = 'Yes'"
