  {
   "name": "page22",
   "elements": [
    {
     "type": "html",
     "name": "question65",
     "maxWidth": "600px",
     "html": "<h4 style=\"text-align:left;font-size:32px\"><b>AUTHORIZATION FOR USE/DISCLOSURE OF HEALTH INFORMATION FOR RESEARCH</b></h4>\n\n<p style=\"text-align:left;color:black;font-size:16px\">To be in this research study you must also give your permission (or authorization) to use and disclose(or share) your “protected health information” (called PHI for short). </p>\n\n<h4 style=\"text-align:left;font-size:16px\"><b>What protected health information will be used and shared during this study?</b></h4>\n\n<p style=\"text-align:left;color:black;font-size:16px\">Cincinnati Children’s Hospital Medical Center (Cincinnati Children’s) will need to use and share your PHI as part of this study. This PHI will come from:</p>\n\n<ul style=\"font-size:16px;color:black\">\n<li>Your Cincinnati Children’s medical records</li>\n<li>Your research records</li>\n</ul>\n\n<p style=\"text-align:left;color:black;font-size:16px\">The types of information that will be used and shared from these records include:</p>\n\n<ul style=\"font-size:16px;color:black\">\n<li>Laboratory test results, diagnosis, and medications</li>\n<li>Reports and notes from clinical and research observations</li>\n<li>Imaging (like CT scans, MRI scans, x-rays, etc.) studies and reports</li>\n<li>If applicable, information concerning HIV testing or the treatment of AIDS or AIDS-related conditions, drug or alcohol abuse, drug-related conditions, alcoholism, and/or psychiatric/psychological conditions (but not psychotherapy notes).</li>\n</ul>\n\n<h4 style=\"text-align:left;font-size:16px\"><b>Who will share, receive and/or use your protected health information in this study?</b></h4>\n\n<ul style=\"font-size:16px;color:black\">\n<li>Staff at all the research study sites (including Cincinnati Children’s)</li>\n<li>Personnel who provide services to you as part of this study</li>\n<li>Other individuals and organizations that need to use your PHI in connection with the research, including people at the sponsor and organizations that the sponsor may use to oversee or conduct the study.</li>\n<li>The members of the Cincinnati Children’s Institutional Review Board and staff of the Office of Research Compliance and Regulatory Affairs.</li>\n</ul>"
    }
   ],
   "visibleIf": "{fromInternal} = 'Yes'"
  },
  {
   "name": "page29",
   "elements": [
    {
     "type": "html",
     "name": "question66",
     "maxWidth": "600px",
     "html": "<h4 style=\"text-align:left;font-size:16px\"><b>How will you know that your PHI is not misused?</b></h4>\n\n<p style=\"text-align:left;color:black;font-size:16px\">People that receive your PHI as part of the research are generally limited in how they can use your PHI.  In addition, most people who receive your PHI are also required by federal privacy laws to protect your PHI.  However, some people that may receive your PHI may not be required to protect it and may share the information with others without your permission, if permitted by the laws that apply to them.</p>\n\n<h4 style=\"text-align:left;font-size:16px\"><b>Can you change your mind?</b></h4>\n\n<p style=\"text-align:left;color:black;font-size:16px\">You may choose to withdraw your permission at any time.  A withdrawal of your permission to use and share your PHI would also include a withdrawal from participation in the research study.  If you wish to withdraw your permission to use and share PHI you need to notify the study doctor, listed on the first page of this document, in writing.  Your request will be effective immediately and no new PHI about you will be used or shared.  The only exceptions are (1) any use or sharing of PHI that has already occurred or was in process prior to you withdrawing your permission and (2) any use or sharing that is needed to maintain the integrity of the research.</p>\n\n<h4 style=\"text-align:left;font-size:16px\"><b>Will this permission expire?</b></h4>\n\n<p style=\"text-align:left;color:black;font-size:16px\">Your permission will expire at the end of the study.</p>\n\n<h4 style=\"text-align:left;font-size:16px\"><b>Will your child’s other medical care be impacted?</b></h4>\n\n<p style=\"text-align:left;color:black;font-size:16px\">By  signing  this  document,  you  /  your  child  agreeto  participate  in  this  research  study  and  give permission to Cincinnati Children’s to use and share you/your child’s PHI for the purpose of this research study. If you refuse to sign this document you/your child will not be able to participate in the study. However, you/your child’s rights concerning treatment not related to this study, payment for services, enrollment in a health plan or eligibility of benefits will not be affected.</p>"
    }
   ],
   "visibleIf": "{fromInternal} = 'Yes'"
  },
